    <div>
      {/* Header */}
      <div className="header">
        <div className="profile-header">
          <img
            src="profile-pic.jpg"
            alt="Profile Picture"
            className="profile-picture"
          />
          <div>
            <h1></h1>
            <p>RIDE-RENTAL</p>
          </div>
        </div>
      </div>




      <div className="contact-info">
        <h2>Contact Info</h2>
        <p>Email: john.doe@example.com</p>
        <p>Phone: (123) 456-7890</p>
      </div>



    </div>
  );
};
